import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Strategy() {
  return (
    <Container
      fluid
      className="my-5 py-5"
      style={{
        paddingLeft: "7rem",
        paddingRight: "7rem",
        fontFamily: "primary-font",
        backgroundColor: "#F9E95D",
      }}
    >
      <div style={{ textAlign: "center" }}>
        <h1 style={{ fontSize: 55 }}>Our strategy</h1>
      </div>

      <Row
        className="g-1 my-5 pt-4"
        style={{
          display: "flex",
          justifyContent: "center",
          marginLeft: "11rem",
        }}
      >
        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
          <p className="mt-4" style={{ fontSize: 30 }}>
            Text
          </p>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
          <p className="mt-4" style={{ fontSize: 30 }}>
            Text
          </p>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
          <p className="mt-4" style={{ fontSize: 30 }}>
            Text
          </p>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
          <p className="mt-4" style={{ fontSize: 30 }}>
            Text
          </p>
        </Col>
      </Row>

      <div
        style={{
          border: "0.5px solid black",
          width: 1600,
          left: 0,
          position: "absolute",
        }}
      ></div>
    </Container>
  );
}

export default Strategy;
